tables.table_schema:
CREATE TABLE public.census_data (
  id INT PRIMARY KEY,
  age INT,
  gender VARCHAR(10),
  ethnicity VARCHAR(50)
);

CREATE TABLE public.population_stats (
  area_id INT PRIMARY KEY,
  total_population INT,
  median_income DECIMAL(10, 2),
  unemployment_rate DECIMAL(5, 2)
);

CREATE TABLE public.policy_research (
  study_id INT PRIMARY KEY,
  research_topic VARCHAR(100),
  researcher_name VARCHAR(100),
  publication_date DATE
);
